/**
 * Get table specific information from the infolist or descriptor
 * \param info Table to update
 * \param err  ObitErr for reporting errors.
 */
static void ObitTableIDI_CALIBRATIONUpdate (ObitTableIDI_CALIBRATION *in, ObitErr *err)
{
  olong i;
  ObitInfoType type;
  gint32 dim[MAXINFOELEMDIM];
  ObitTableDesc *desc;
   union ObitInfoListEquiv InfoReal; 

 /* error checks */
   g_assert(ObitErrIsA(err));
  if (err->error) return;
  g_assert (ObitIsA(in, &myClassInfo));

  /* Get Keywords */
   /* tabrev */
  in->tabrev = 1; 
  ObitInfoListGetTest(in->myDesc->info, "TABREV", &type, dim, 
		       (gpointer)&in->tabrev);
   /* numPol */
  if (!ObitInfoListGet(in->myDesc->info, "NO_POL", &type, dim, 
		       (gpointer)&in->numPol, err)) return;
   /* no_stkd */
  in->no_stkd = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_STKD", &type, dim, 
		       (gpointer)&in->no_stkd);
   /* stk_1 */
  in->stk_1 = -1; 
  ObitInfoListGetTest(in->myDesc->info, "STK_1", &type, dim, 
		       (gpointer)&in->stk_1);
   /* no_band */
  in->no_band = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_BAND", &type, dim, 
		       (gpointer)&in->no_band);
   /* no_chan */
  in->no_chan = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_CHAN", &type, dim, 
		       (gpointer)&in->no_chan);
  in->ref_freq = 1.0; 
  InfoReal.dbl = 1.0; 
  type = OBIT_double;
  ObitInfoListGetTest(in->myDesc->info, "REF_FREQ", &type, dim, 
		       (gpointer)&InfoReal);
  if (type==OBIT_double) in->ref_freq = InfoReal.dbl;
  if (type==OBIT_float)  in->ref_freq = InfoReal.flt;
  in->chan_bw = 1.0; 
  InfoReal.dbl = 1.0; 
  type = OBIT_double;
  ObitInfoListGetTest(in->myDesc->info, "CHAN_BW", &type, dim, 
		       (gpointer)&InfoReal);
  if (type==OBIT_double) in->chan_bw = InfoReal.dbl;
  if (type==OBIT_float)  in->chan_bw = InfoReal.flt;
   /* ref_pixl */
  in->ref_pixl = 1.0; 
  ObitInfoListGetTest(in->myDesc->info, "REF_PIXL", &type, dim, 
		       (gpointer)&in->ref_pixl);
   /* obscode */
  strncpy (in->obscode, "    ", MAXKEYCHARTABLEIDI_CALIBRATION); 
  ObitInfoListGetTest(in->myDesc->info, "OBSCODE", &type, dim, 
		       (gpointer)&in->obscode);
   /* ArrName */
  if (!ObitInfoListGet(in->myDesc->info, "ARRNAM", &type, dim, 
		       (gpointer)&in->ArrName, err)) return;
   /* RefDate */
  strncpy (in->RefDate, "YYYY-MM-DD", MAXKEYCHARTABLEIDI_CALIBRATION); 
  ObitInfoListGetTest(in->myDesc->info, "RDATE", &type, dim, 
		       (gpointer)&in->RefDate);
   /* numAnt */
  if (!ObitInfoListGet(in->myDesc->info, "NO_ANT", &type, dim, 
		       (gpointer)&in->numAnt, err)) return;

  /* initialize column numbers/offsets */
  in->TimeOff = -1;
  in->TimeCol = -1;
  in->TimeIOff = -1;
  in->TimeICol = -1;
  in->SourIDOff = -1;
  in->SourIDCol = -1;
  in->antNoOff = -1;
  in->antNoCol = -1;
  in->ArrayOff = -1;
  in->ArrayCol = -1;
  in->fqidOff = -1;
  in->fqidCol = -1;
  in->TSys1Off = -1;
  in->TSys1Col = -1;
  in->TAnt1Off = -1;
  in->TAnt1Col = -1;
  in->sensitivity1Off = -1;
  in->sensitivity1Col = -1;
  in->phase1Off = -1;
  in->phase1Col = -1;
  in->rate1Off = -1;
  in->rate1Col = -1;
  in->delay1Off = -1;
  in->delay1Col = -1;
  in->real1Off = -1;
  in->real1Col = -1;
  in->imag1Off = -1;
  in->imag1Col = -1;
  in->weight1Off = -1;
  in->weight1Col = -1;
  in->refant1Off = -1;
  in->refant1Col = -1;
  in->TSys2Off = -1;
  in->TSys2Col = -1;
  in->TAnt2Off = -1;
  in->TAnt2Col = -1;
  in->sensitivity2Off = -1;
  in->sensitivity2Col = -1;
  in->phase2Off = -1;
  in->phase2Col = -1;
  in->rate2Off = -1;
  in->rate2Col = -1;
  in->delay2Off = -1;
  in->delay2Col = -1;
  in->real2Off = -1;
  in->real2Col = -1;
  in->imag2Off = -1;
  in->imag2Col = -1;
  in->weight2Off = -1;
  in->weight2Col = -1;
  in->refant2Off = -1;
  in->refant2Col = -1;
  /* Find columns and set offsets */
  desc = in->myDesc;
  if (desc->FieldName) {
    for (i=0; i<desc->nfield; i++) {
      if (!strncmp (desc->FieldName[i], "TIME    ", 8)) {
	 in->TimeOff = desc->offset[i];
 	 in->TimeCol = i;
      }
      if (!strncmp (desc->FieldName[i], "TIME INTERVAL", 13)) {
	 in->TimeIOff = desc->offset[i];
 	 in->TimeICol = i;
      }
      if (!strncmp (desc->FieldName[i], "SOURCE_ID", 9)) {
	 in->SourIDOff = desc->offset[i];
 	 in->SourIDCol = i;
      }
      if (!strncmp (desc->FieldName[i], "ANTENNA_NO", 10)) {
	 in->antNoOff = desc->offset[i];
 	 in->antNoCol = i;
      }
      if (!strncmp (desc->FieldName[i], "ARRAY", 5)) {
	 in->ArrayOff = desc->offset[i];
 	 in->ArrayCol = i;
      }
      if (!strncmp (desc->FieldName[i], "FREQID  ", 8)) {
	 in->fqidOff = desc->offset[i];
 	 in->fqidCol = i;
      }
      if (!strncmp (desc->FieldName[i], "TSYS_1", 6)) {
	     in->TSys1Off = desc->offset[i];
 	     in->TSys1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "TANT_1", 6)) {
	     in->TAnt1Off = desc->offset[i];
 	     in->TAnt1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "SENSITIVITY_1", 13)) {
	     in->sensitivity1Off = desc->offset[i];
 	     in->sensitivity1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PHASE_1", 7)) {
	     in->phase1Off = desc->offset[i];
 	     in->phase1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "RATE_1", 6)) {
	     in->rate1Off = desc->offset[i];
 	     in->rate1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "DELAY_1", 7)) {
	     in->delay1Off = desc->offset[i];
 	     in->delay1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "REAL_1", 6)) {
	     in->real1Off = desc->offset[i];
 	     in->real1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "IMAG_1", 6)) {
	     in->imag1Off = desc->offset[i];
 	     in->imag1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "WEIGHT_1", 8)) {
	     in->weight1Off = desc->offset[i];
 	     in->weight1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "REFANT_1", 8)) {
	     in->refant1Off = desc->offset[i];
 	     in->refant1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "TSYS_2", 6)) {
	     in->TSys2Off = desc->offset[i];
 	     in->TSys2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "TANT_2", 6)) {
	     in->TAnt2Off = desc->offset[i];
 	     in->TAnt2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "SENSITIVITY_2", 13)) {
	     in->sensitivity2Off = desc->offset[i];
 	     in->sensitivity2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PHASE_2", 7)) {
	     in->phase2Off = desc->offset[i];
 	     in->phase2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "RATE_2", 6)) {
	     in->rate2Off = desc->offset[i];
 	     in->rate2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "DELAY_2", 7)) {
	     in->delay2Off = desc->offset[i];
 	     in->delay2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "REAL_2", 6)) {
	     in->real2Off = desc->offset[i];
 	     in->real2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "IMAG_2", 6)) {
	     in->imag2Off = desc->offset[i];
 	     in->imag2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "WEIGHT_2", 8)) {
	     in->weight2Off = desc->offset[i];
 	     in->weight2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "REFANT_2", 8)) {
	     in->refant2Off = desc->offset[i];
 	     in->refant2Col = i;
      }
     }
  }

  /* Check required columns */
  Obit_return_if_fail((in->TimeOff > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column Time");
  Obit_return_if_fail((in->TimeIOff > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column TimeI");
  Obit_return_if_fail((in->SourIDOff > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column SourID");
  Obit_return_if_fail((in->antNoOff > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column antNo");
  Obit_return_if_fail((in->ArrayOff > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column Array");
  Obit_return_if_fail((in->fqidOff > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column fqid");
  if (in->numPol>=1) {
    Obit_return_if_fail((in->TSys1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column TSys1");
    Obit_return_if_fail((in->TAnt1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column TAnt1");
    Obit_return_if_fail((in->sensitivity1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column sensitivity1");
    Obit_return_if_fail((in->phase1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column phase1");
    Obit_return_if_fail((in->rate1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column rate1");
    Obit_return_if_fail((in->delay1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column delay1");
    Obit_return_if_fail((in->real1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column real1");
    Obit_return_if_fail((in->imag1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column imag1");
    Obit_return_if_fail((in->weight1Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column weight1");
  } /* end of if index in range */
  if (in->numPol>=2) {
    Obit_return_if_fail((in->TSys2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column TSys2");
    Obit_return_if_fail((in->TAnt2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column TAnt2");
    Obit_return_if_fail((in->sensitivity2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column sensitivity2");
    Obit_return_if_fail((in->phase2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column phase2");
    Obit_return_if_fail((in->rate2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column rate2");
    Obit_return_if_fail((in->delay2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column delay2");
    Obit_return_if_fail((in->real2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column real2");
    Obit_return_if_fail((in->imag2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column imag2");
    Obit_return_if_fail((in->weight2Off > -1), err,
       "ObitTableIDI_CALIBRATIONUpdate: Could not find column weight2");
  } /* end of if index in range */
} /* end ObitTableIDI_CALIBRATIONUpdate */

/**
 * Copy table specific (keyword) information  to infolist.
 * \param info Table to update
 * \param err  ObitErr for reporting errors.
 */
static void ObitTableIDI_CALIBRATIONDumpKey (ObitTableIDI_CALIBRATION *in, ObitErr *err)
{
  ObitInfoList *info=NULL;
  ObitInfoType type;
  gint32 dim[MAXINFOELEMDIM] = {1,1,1,1,1};

 /* error checks */
   g_assert(ObitErrIsA(err));
  if (err->error) return;
  g_assert (ObitIsA(in, &myClassInfo));

  /* Set Keywords */
  if (in->myIO!=NULL) info = ((ObitTableDesc*)(in->myIO->myDesc))->info;
  else info = in->myDesc->info;
  /* tabrev */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "TABREV", type, dim, 
		  (gpointer)&in->tabrev);
  /* numPol */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_POL", type, dim, 
		  (gpointer)&in->numPol);
  /* no_stkd */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_STKD", type, dim, 
		  (gpointer)&in->no_stkd);
  /* stk_1 */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "STK_1", type, dim, 
		  (gpointer)&in->stk_1);
  /* no_band */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_BAND", type, dim, 
		  (gpointer)&in->no_band);
  /* no_chan */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_CHAN", type, dim, 
		  (gpointer)&in->no_chan);
  /* ref_freq */
  type  = OBIT_double;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "REF_FREQ", type, dim, 
		  (gpointer)&in->ref_freq);
  /* chan_bw */
  type  = OBIT_double;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "CHAN_BW", type, dim, 
		  (gpointer)&in->chan_bw);
  /* ref_pixl */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "REF_PIXL", type, dim, 
		  (gpointer)&in->ref_pixl);
  /* obscode */
  type  = OBIT_string;
  dim[0] = MAXKEYCHARTABLEIDI_CALIBRATION;
  ObitInfoListAlwaysPut(info, "OBSCODE", type, dim, 
		  (gpointer)&in->obscode);
  /* ArrName */
  type  = OBIT_string;
  dim[0] = MAXKEYCHARTABLEIDI_CALIBRATION;
  ObitInfoListAlwaysPut(info, "ARRNAM", type, dim, 
		  (gpointer)&in->ArrName);
  /* RefDate */
  type  = OBIT_string;
  dim[0] = MAXKEYCHARTABLEIDI_CALIBRATION;
  ObitInfoListAlwaysPut(info, "RDATE", type, dim, 
		  (gpointer)&in->RefDate);
  /* numAnt */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_ANT", type, dim, 
		  (gpointer)&in->numAnt);
   
} /* end ObitTableIDI_CALIBRATIONDumpKey */
